const Kisar = () => {
  return (
    <div>
      <h3 className="display-4">Fotografía y Video para tu evento</h3>
      <p>KISAR PRODUCCIONES – Capturando Emociones</p>
      <div className="row text-wrap">
        <img src="/boda.jpg"></img>
        <img src="/danza.jpg"></img>
        <img src="/15.jpg"></img>
      </div>
      <a href="#">Contactanos</a>
      <style jsx>
        {`
          div {
            display: Flex;
            flex-direction: column;
            flex: 1;
            justify-content: center;
            align-items: center;
            background-image: url('/boqueh.jpg');
            width: 100%;
            height: 500px;
            color: white;
          }
          ,
          img {
            height: 280px;
            width: 280px;
            border-radius: 5px;
            margin: 20px;
          }
           {
            /* .images {
            display: Flex;
            flex-direction: row;
            flex-wrap: wrap;
          } */
          }
        `}
      </style>
    </div>
  );
};
export default Kisar;
